import Link from 'next/link';
import styled from 'styled-components';

export const A = styled.a`
    font-size: 1.5em;
    text-align: center;
    color: palevioletred;
  `;
  
const Header = () => (
  <div>
    <Link href="/">
      <A><a>Latest posts</a></A>
    </Link>
    <Link href="/new">
      <a>New post</a>
    </Link>
  </div>
);
  
export default Header;
